window.bookSummaryJSON = "<p><b>The dead walk the land. The dungeon rises. War will move the Heavens and the Earth.&nbsp;</b></p> <p>Powerful necromancers are on the move, and the dungeon has become a battleground. Without his faithful Wisp, Cal's mind slips - he begins creating traps and monsters that go against his already loose morals.&nbsp;</p> <p>A direct threat from an unexpected force causes Cal's mind to stabilize, but he doesn't know for how long. Using every resource at his disposal, he works to keep his mind clear while he funds a search for his lost companion. When others fail him again and again, Cal takes matters into his own hands.&nbsp;</p> <p>Deadly situations remind Dale that no matter how well he does in his secluded community, he is still considered a weakling in the greater world. Deciding that his physical and mental training are not enough, Dale resolves to gain strength by any means necessary.&nbsp;</p> <p>Both are aware that they need to keep moving. If they stop, their choices could kill them.</p>"; 
